#include <iostream>
#include <algorithm>
#include <string>
#include <vector>
#include <map>

using namespace std;


string shortestPalindrome(string s) {
    string result;
    if (s.empty()){
	return result;
    }
    string rev = s;
    reverse(rev.begin(), rev.end());
    string str = s + '#' + rev;
    vector<int> next;
    next.resize(str.size() + 1);
    for(int i=1; i<next.size(); i++) { 
	int j=next[i-1];
	while (j>0 && str[j]!=str[i]) 
	    j=next[j-1]; 
	next[i] = j + (str[j]==str[i]? 1 : 0); 
    }
    result = s.substr(next[str.size()-1]);
    reverse(result.begin(), result.end());
    return result+s;
}

int main( int argc, char *argv[] ) {
    string s = "aacecaaa";
    cout << shortestPalindrome(s) << endl;
    s = "abcd";
    cout << shortestPalindrome(s) << endl;
    s = "aacd";
    cout << shortestPalindrome(s) << endl;
    s = "cdaa";
    cout << shortestPalindrome(s) << endl;
    s = "abb";
    cout << shortestPalindrome(s) << endl;
    s = "ab";
    cout << shortestPalindrome(s) << endl;
    s = "a";
    cout << shortestPalindrome(s) << endl;
    return 0;
    s ="";

    cout << shortestPalindrome(s) << endl;
    return 0;
}
